import React, { useState } from "react";
import axios from "axios";

export default function PersonalizedNews() {
  const [selectedCategory, setSelectedCategory] = useState("");
  const [newsList, setNewsList] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  // Predefined list of categories
  const categories = [
    "SPORTS", "ENTERTAINMENT", "POLITICS", "TECHNOLOGY",
    "HEALTH", "BUSINESS", "SCIENCE", "EDUCATION"
  ];

  const fetchPersonalizedNews = async (e) => {
    e.preventDefault();
    if (!selectedCategory) {
      alert("Please select a category.");
      return;
    }

    setLoading(true);
    setError("");
    setNewsList([]);

    try {
      const response = await axios.get("http://localhost:8080/admin/personalizedNews", {
        params: { prefDetails: selectedCategory.toUpperCase() },
      });

      if (response.data.length === 0) {
        setError("No news found for this category.");
      } else {
        setNewsList(response.data);
      }
    } catch (error) {
      console.error("Error fetching personalized news:", error);
      setError("Failed to fetch personalized news. Please try again later.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-6 bg-gray-100 min-h-screen flex justify-center items-center">
      <div className="w-full max-w-5xl bg-white p-6 rounded-lg shadow-lg">
        <h1 className="text-2xl font-bold text-green-700 text-center mb-6">Prefered News</h1>

        {/* Form Section */}
        <form onSubmit={fetchPersonalizedNews} className="mb-6 flex flex-col md:flex-row items-center gap-4">
          <select
            className="flex-1 px-4 py-2 rounded-md border border-gray-400 bg-white text-gray-700 focus:ring-2 focus:ring-green-500"
            value={selectedCategory}
            onChange={(e) => setSelectedCategory(e.target.value)}
            required
          >
            <option value="">-- Select a Category --</option>
            {categories.map((category, index) => (
              <option key={index} value={category}>
                {category.charAt(0).toUpperCase() + category.slice(1).toLowerCase()}
              </option>
            ))}
          </select>
          <button
            type="submit"
            disabled={loading}
            className={`px-5 py-2 rounded-md text-white transition duration-300 ${
              loading ? "bg-gray-500 cursor-not-allowed" : "bg-green-600 hover:bg-green-700"
            }`}
          >
            {loading ? "Fetching..." : "Fetch News"}
          </button>
        </form>

        {/* Error Message */}
        {error && <p className="text-red-500 text-center mb-4">{error}</p>}

        {/* News Table */}
        {newsList.length > 0 && !error && (
          <div className="overflow-x-auto">
            <table className="w-full border-collapse border border-gray-300 rounded-lg text-left">
              <thead className="bg-green-600 text-white">
                <tr>
                  <th className="border border-gray-300 px-4 py-3">News ID</th>
                  <th className="border border-gray-300 px-4 py-3">Title</th>
                  <th className="border border-gray-300 px-4 py-3">Content</th>
                  <th className="border border-gray-300 px-4 py-3">Category</th>
                  <th className="border border-gray-300 px-4 py-3">Author</th>
                  <th className="border border-gray-300 px-4 py-3">Published Date</th>
                </tr>
              </thead>
              <tbody>
                {newsList.map((news, index) => (
                  <tr key={index} className="bg-white text-gray-800 hover:bg-gray-100">
                    <td className="border border-gray-300 px-4 py-3">{index + 1}</td>
                    <td className="border border-gray-300 px-4 py-3">{news.title}</td>
                    <td className="border border-gray-300 px-4 py-3">{news.content}</td>
                    <td className="border border-gray-300 px-4 py-3">{news.category}</td>
                    <td className="border border-gray-300 px-4 py-3">{news.author || "N/A"}</td>
                    <td className="border border-gray-300 px-4 py-3">{news.date || "N/A"}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}
